### Summary of Core Topics, Concepts, Principles, and Equations

#### Database Management Systems

1. **Normalization and Functional Dependencies**
   - **Normal Forms**: 1NF, 2NF, 3NF, BCNF, 4NF
   - **Functional Dependencies (FD)**: Defined as \( X \rightarrow Y \), where \( X \) determines \( Y \).
   - **Multivalued Dependencies (MVD)**: Defined as \( X \twoheadrightarrow Y \), where \( X \) determines multiple values of \( Y \).
   - **Boyce-Codd Normal Form (BCNF)**: A relation is in BCNF if for every non-trivial FD \( X \rightarrow Y \), \( X \) is a superkey.
   - **Fourth Normal Form (4NF)**: A relation is in 4NF if it is in BCNF and has no non-trivial MVDs.

2. **Decomposition**
   - **Dependency Preservation**: Ensuring that all functional dependencies are preserved in the decomposed relations.
   - **Lossless Join Decomposition**: Ensuring that the original relation can be reconstructed from the decomposed relations without loss of information.

3. **Database Connectivity**
   - **PostgreSQL Connection**: Using `psycopg2` library in Python to connect to a PostgreSQL database.
     ```python
     connection = psycopg2.connect(database=dbname, user=username, password=pwd, host=address, port=portnum)
     ```

4. **Superkeys and Candidate Keys**
   - **Superkey**: A set of attributes that uniquely identifies a tuple in a relation.
   - **Candidate Key**: A minimal superkey, meaning no proper subset of the superkey is a superkey itself.

5. **Disk Storage and Access Time**
   - **Storage Capacity**: Calculated as:
     \[
     \text{Storage Capacity} = \text{Number of Platters} \times \text{Surfaces per Platter} \times \text{Tracks per Surface} \times \text{Sectors per Track} \times \text{Bytes per Sector}
     \]
   - **Disk Access Time**: Calculated as:
     \[
     \text{Disk Access Time} = \text{Seek Time} + \text{Rotational Latency}
     \]
     where Rotational Latency is given by:
     \[
     \text{Rotational Latency} = \frac{60,000}{\text{RPM}} \text{ ms}
     \]

#### Data Structures

1. **Binary Search Tree (BST)**
   - **Insertion**: Process of adding nodes to the BST while maintaining the BST property.
   - **Height**: The length of the longest path from the root to a leaf.
   - **Leaf Nodes**: Nodes with no children.
   - **Levels**: The root is at level 0, its children at level 1, and so on.

